// import AppNav from "./AppNav";
import Sidebar from "./Sidebar";
import styles from "./AppLayout.module.css";
import Map from "./Map";

function AppLayout()
{
    return(
        <div className={styles.app}>
            <Sidebar></Sidebar>
            <Map></Map>
        </div>
    );
}

export default AppLayout;
